export default function SearchResults({ results }) {
    return(
        <div style={{ 
            width: "100%",
            padding: "0rem 2rem 0rem 2rem"
        }}>
            {results?.map((value) => {
                return (
                <div key={value.id} style={{ backgroundColor: "#E8E7E7", marginTop: 5, marginBottom: 5, padding: 10, width: "100%" }}>
                    <p>{value.name}</p>
                    <p>{value.email}</p>
                </div>
                );
            })
            }
        </div>
    );
}
